import React,{useState,useEffect} from 'react';

const data={
    title:'See the future',
    demoButton:{
        label:'Get a Demo',
        href:''
    },
    useCaseButton:{
        label:'Read Use Cases',
        href:''
    }
}


export default function DefaultUseCases(){ 

     //State for JSON Data
     const [info,setInfo]=useState(null);

     //Component Lifecycle
     useEffect(()=>{
         setInfo(data);
     },[])


     //if data hasn't loaded display loading message
     if(!info) return <p>Loading... </p>

     //destructure info object
     const {title,demoButton,useCaseButton}=info;

     //React Component
     return(
         <section className="container-fluid bg-primary">
            <div className="row">
             <h3 className="col-12 m-5 justify-content-center d-flex text-white font-weight-bold"> 
                {title}
             </h3>

            </div>
             <div className='row'>
                 <a href={demoButton.href} className="btn btn-primary bg-white text-dark shadow-lg rounded">{demoButton.label}</a>
                 <a href={useCaseButton.href} className="btn btn-seconadry text-white border-white shadow-lg rounded">{useCaseButton.label}</a>
             </div>
         </section>
     )
}
